    //PDF
    public exportAsPdfFile(title: string, json: any, fileName: string): void {

        var col = [];
        var rows = [];
        var doc = new jsPDF2('l', 'mm', [297, 210]);

        // buat Header di dokumen
        for (let key in json[0]) {
            col.push(key);
        }
        // console.log(col);

        // buat isi data di dokumen
        for (var key in json) {
            var temp = json[key];
            var arr = Object.keys(temp)
                .map(function (key) {
                    return temp[key]
                });
            rows.push(arr);
        }
        // console.log(rows);

        doc.setFontSize(12);
        doc.text(20, 20, title);
        doc.autoTable(col, rows);
        doc.save(fileName + PDF_EXTENSION);
    }


